import React, { Component } from "react";
import Plus from "../../images/плюсик.png";

export class Item extends Component {
    render() {
        return (
            <div>
                <a className="cars__plus"><img src={Plus} alt=""/></a>
                <img className="card__image" src={"./img/" + this.props.item.image} alt=""/>
                <p className="card__category">{this.props.item.category}</p>
                <p className="card__title">{this.props.item.title}</p>
                <div className="card__info">
                    <p class="card__desc">способ обработки {this.props.item.desc}</p>
                    <p class="card__bitterness">горечь {this.props.item.desc}</p>
                    <p class="card__acidity">кислотность {this.props.item.desc}</p>
                    <p class="card__density">плотность {this.props.item.desc}</p>
                </div>

            </div>
        )
    }
}

export default Item;
